import React from 'react';
import { Prediction } from '../types';

interface Props {
  prediction: Prediction;
  isAI: boolean;
}

const PredictionCard: React.FC<Props> = ({ prediction, isAI }) => {
  return (
    <div className="border rounded-lg p-4 bg-white shadow mb-4">
      <h3 className="text-lg font-semibold">{prediction.asset}/USD</h3>
      <p className="text-2xl">${prediction.predictedPrice.toLocaleString()}</p>
      <p className="text-gray-600">{prediction.reasoning}</p>
      <button className="mt-4 bg-blue-500 text-white px-4 py-2 rounded">
        Support Prediction
      </button>
    </div>
  );
};

export default PredictionCard;
